function Card(props)
{
    return(
        <div class="card col-3 m-3">
            <img class="card-img-top" src={`${props.props.images}`} alt="logo"/>
            <div class="card-body">
                <h3 class="card-title">{props.props.title.substring(50)}...</h3>
                <p class="card-text">{props.props.description.substring(50)}...</p>
                <p>Rs. {props.props.price}</p>
            </div>
        </div>
    )
}

export default Card;
